import * as React from 'react';
import Login from './comments/Login/Login'
import TopicPage from '../src/comments/TopicPage/TopicPage'
import './App.css';

class App extends React.Component {
  render(){
    return (
      <div>
        <div className='App-header'>
          {
            this.state.appselect?
            <Login/>
            :''
          }

          {
            !this.state.appselect?
            <TopicPage/>
            :''
          }
        </div>
      </div>
    );
  }

}

export default App;
